import React from 'react';
import email from './assets/mail-bulk-solid.svg';
import background from './assets/animated-shape.svg';
import {
  ICON_ALT,
  WEBSITE_EMAIL,
  WEBSITE_EMAIL_LINK,
  WEBSITE_TITLE,
} from './constants';

function App() {
  return (
    <div className="flex justify-center items-center h-screen w-screen flex-col">
      <img src={background} className="w-screen h-screen" />
      <header className="flex flex-col gap-y-8 text-center text-3xl">
        <h1 className="font-grechen-fuemen">{WEBSITE_TITLE}</h1>
        <p className="flex gap-x-2">
          <img src={email} alt={ICON_ALT} className="w-8 h-8" />
          <a href={WEBSITE_EMAIL_LINK} className="text-xl font-arvo">
            {WEBSITE_EMAIL}
          </a>
        </p>
      </header>
    </div>
  );
}

export default App;
